// StudentPage.js
import React from "react";

function StudentPage({ currentUser, mealMarked, markMeal, handleLogout }) {
  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h2>Welcome, {currentUser.email}</h2>
      <h3>Mark your meals</h3>

      <button onClick={() => markMeal("breakfast")}>
        {mealMarked.breakfast ? "Unmark Breakfast" : "Mark Breakfast"}
      </button>

      <button onClick={() => markMeal("lunch")}>
        {mealMarked.lunch ? "Unmark Lunch" : "Mark Lunch"}
      </button>

      <button onClick={() => markMeal("supper")}>
        {mealMarked.supper ? "Unmark Supper" : "Mark Supper"}
      </button>

      <br />
      <button onClick={handleLogout} style={{ marginTop: "20px" }}>
        Logout
      </button>
    </div>
  );
}

export default StudentPage;
